INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (14112025, 0, "やった！　これにて完成でござるよ～！\nう～ん、色使いといい、タッチといい、\n今度も素晴らしい出来栄えですな～！", 1, 10, 11, 0.5, 1, 101311, 14112, 0);
