INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (14112035, 0, "あら？　でも……\n片づけはもう済んでるみたいよ？\nうふふ、いったいどこの「いい子」が\nやってくれたのかしらね～？", 1, 10, 11, 0.5, 1, 105111, 14112, 0);
