INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (16612036, 0, "あははっ！　そういうエリコ様も\nおててが絵の具だらけでござるよ～！\nむふふ、いわゆるギャップ萌え\nというやつですな？", 1, 10, 11, 0.5, 1, 101311, 16612, 0);
