INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (23812026, 0, "はぁ、思わずため息が出るよ。\nかわいいボクが、美しい絵を描く。\nただそれだけで、言葉にできないほど\n尊い場面になってしまうよね？", 1, 10, 11, 0.5, 1, 100811, 23812, 0);
