INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (23812031, 0, "そ、そうですね……\nそんなきれいな風景の中で、\nただ一人辱めを受けている\n自分とかを想像すると……じゅるり♪", 1, 10, 11, 0.5, 1, 104511, 23812, 0);
