INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (23812036, 0, "オー、まさに陰と陽！\nこれがゲージュツの分野で\nいうところの、コントラストと\nいうヤツなのでショウか？", 1, 10, 11, 0.5, 1, 103011, 23812, 0);
