INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (25212018, 0, "よし、なかなか上手く描けたよ。\nでも、弟くんへの愛を表すには\nまだちょっと足りなかったかなあ？", 1, 10, 11, 0.5, 1, 104911, 25212, 0);
