INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (25212023, 0, "そういうのは今はいいですから！\nでもお姉ちゃん美人で頭良くて強いのに\n絵までうまいんですねえ……\nまさに文句上等？　ってやつですよ。", 1, 10, 11, 0.5, 1, 101111, 25212, 0);
